                    ${data.origin_name && data.origin_link ? `<p><a href="${data.origin_link}">${data.origin_name}</a></p>` : ''}
                </td>
                <td>${data.origin}</td>
                <td>${data.difficulty}</td>
                <td>${data.tags.join(', ')}</td>
                <td>${data.note.trim().split('\n').map((line) => `<p>${line.trim()}</p>`).join('')}</td>
            </tr>
        `).join('');
    };
</script>
